script: |
  super -f text -I q7197.spq | sort > q7197.out

inputs:
  - name: q7197.spq
    data: |
      SELECT DISTINCT + col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( - 91 ) NOT BETWEEN - col0 + + col2 + + - col0 AND - + ( - - col0 ) - + + col1;
  - name: tab0

outputs:
  - name: q7197.out
    data: |
      15
      87
      97
